import React from 'react';
import { Card, Icon, Image, Grid} from 'semantic-ui-react';

 const MovieCard = ({ movie }) => (
    <Grid.Column>
    <Card
     image={movie.cover}
     header={movie.title}
   />
   </Grid.Column>
 )

export default MovieCard;
